libs.content:
find_library(${_var}_library_release
     names ${_${_var}_names}
     hints
        ${bullet_search_dirs}
        $env{bullet_root_dir}
        ${bullet_root}
        path_suffixes lib lib/release out/release8/libs
  )

find_library(${_var}_library_debug
     names ${_${_var}_debug_names}
     hints
        ${bullet_search_dirs}
        $env{bullet_root_dir}
        ${bullet_root}
        path_suffixes lib lib/debug out/debug8/libs
  )

deps.context:
find_package(
  qt5 components
  gui widgets multimedia network qml quick script svg
  ${platform_qt_components}
  webchannel websockets
)
